import './App.css';

import {Routes, Route, useNavigate} from "react-router-dom";
import {useState} from "react";

import DoctorStrange from './doctorstrange';
import RRR from './rrr';
import KGF2 from './kgf2';
import Beast from './beast';
import KashmirFiles from './kashmirfiles';
import SOD from './sod';
import Jersey from './jersey';

import Contact from './contact';
import MainPage from './MainPage';

function App() {
  const[movieName, setMovieName] = useState("Doctor Strange");

  function movieDoctorStrange(){
    setMovieName("Doctor Strange")
  }

  function movieRRR(){
    setMovieName("RRR")
  }

  function movieKGF2(){
    setMovieName("KGF2")
  }

  function movieBeast(){
    setMovieName("Beast")
  }

  function movieSOD(){
    setMovieName("Secrets of Dumbledore")
  }

  function movieKashmirFiles(){
    setMovieName("Kashmir Files")
  }

  function movieJersey(){
    setMovieName("Jersey")
  }


  const navigate= useNavigate();
  function Navigator(position){
    navigate(position)
  }

  return (


      <Routes>
        <Route exact path="/" element={<MainPage navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>
        <Route exact path="/doctorstrange" element={<DoctorStrange navigateToPage={Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange} />}></Route>
        <Route exact path="/bookshowDoctorStrange" element={<Contact navigateToPage= {Navigator} movieVariable={movieName} setMovieFunc={movieDoctorStrange}/>}></Route>

      </Routes>
  );
}

export default App;
